func Benchmark_filter(b *testing.B) {
	type Item struct {
		Value int
	}
	type Env struct {
		Items []Item
	}

	program, err := expr.Compile(`filter(filter(Items, {.Value % 2 == 0}), {.Value % 3 == 0})`, expr.Env(Env{}))
	if err != nil {
		b.Fatal(err)
	}

	env := Env{
		Items: make([]Item, 100),
	}
	for i := 1; i <= 100; i++ {
		env.Items[i-1].Value = i
	}

	var out interface{}
	for n := 0; n < b.N; n++ {
		out, err = vm.Run(program, env)
	}

	if err != nil {
		b.Fatal(err)
	}
	if len(out.([]interface{})) != 16 {
		b.Fail()
	}
}

