type CallEnv struct {
	A      int
	B      int
	C      int
	Fn     func() bool
	FnFast func(...interface{}) interface{}
	Foo    CallFoo
}

func (CallEnv) Func() string {
	return "func"
}

type CallFoo struct {
	D int
	E int
	F int
}

func (CallFoo) Method() string {
	return "method"
}

